import Navbar from './Navbar';
import About from './pages/About';
function App() {
  let Component

  // eslint-disable-next-line default-case
  switch(window.location.pathname){
    case "/": 
    Component = App
      break
    case "/about":
    Component = About
      break
    case "/cart":
    Component = App

      break
  }
  return <Navbar />


}

export default App;
